def apply_convolution_full(arr1 : np.ndarray, arr2 : np.ndarray) -> np.ndarray:
    if len(arr1) < len(arr2):
        arr1, arr2 = arr2, arr1

    out_length = len(arr1) + len(arr2) -1
    out = np.zeros(out_length)

    for i in range(out_length):
        lower_bound = max(0, i - len(arr2) + 1)
        upper_bound = min(len(arr1), i+1)

        for j in range(lower_bound, upper_bound):
            out[i] += arr1[j] * arr2[i-j]

    return out

