import numpy as np

def compute_localmin(x: np.ndarray, axis: int) -> np.ndarray:
    """Find local minima in an array

    An element `x[i]` is considered a local minimum if the following conditions are met:

    1. `x[i] < x[i-1]`
    2. `x[i] <= x[i+1]`

    Note that the first condition is strict, and that the first element
    `x[0]` will never be considered as a local minimum.
    """
    minima = np.zeros_like(x, dtype=bool)
    if x.ndim == 1:
        x = x.reshape((-1, 1))
        axis = 0

    if axis == 0:
        for i in range(1, x.shape[0] - 1):
            minima[i] = (x[i] < x[i - 1]) & (x[i] <= x[i + 1])
    elif axis == 1:
        for i in range(1, x.shape[1] - 1):
            minima[:, i] = (x[:, i] < x[:, i - 1]) & (x[:, i] <= x[:, i + 1])
    else:
        raise Exception("Invalid axis specified")

    return np.asarray(minima)

